from hypothesis import given, strategies as st, settings
from pandas.tseries.frequencies import is_subperiod, is_superperiod

freq_strings = st.sampled_from(['D', 'W', 'M', 'Q', 'Y', 'h', 'B'])

@given(freq_strings)
@settings(max_examples=50)
def test_is_subperiod_self_consistency(freq):
    result_sub = is_subperiod(freq, freq)
    result_super = is_superperiod(freq, freq)

    assert result_sub == result_super, \
        f"Self-inconsistent: is_subperiod({freq}, {freq})={result_sub} != is_superperiod({freq}, {freq})={result_super}"

if __name__ == "__main__":
    test_is_subperiod_self_consistency()

from pandas.tseries.frequencies import is_subperiod, is_superperiod

frequencies = ['D', 'W', 'M', 'Q', 'Y', 'h', 'B', 'T', 'S', 'L', 'U', 'N']

print("Testing self-consistency for all frequencies:\n")
print(f"{'Frequency':<10} {'is_subperiod':<15} {'is_superperiod':<15} {'Consistent?':<12}")
print("-" * 52)

inconsistent = []
for freq in frequencies:
    try:
        sub = is_subperiod(freq, freq)
        sup = is_superperiod(freq, freq)
        consistent = sub == sup
        print(f"{freq:<10} {str(sub):<15} {str(sup):<15} {str(consistent):<12}")
        if not consistent:
            inconsistent.append(freq)
    except Exception as e:
        print(f"{freq:<10} Error: {e}")

if inconsistent:
    print(f"\nInconsistent frequencies: {inconsistent}")
else:
    print("\nAll frequencies are consistent!")
